Job.MainScript:
# Pfad f&#252;r den Ordner $ordnerPfad = &quot;C:\TEMP\Agenttest_Filedependency&quot;
# Pfad f&#252;r die Dateien $dateiPfad = &quot;$ordnerPfad\Agenttest_Filedependency_Datei.txt&quot; $dateiPfad2 = &quot;$ordnerPfad\Agenttest_Filedependency_Datei2.txt&quot;
# Text zum Schreiben $text = &quot;Dies ist ein Testtext f&#252;r den Agententest. &quot; * 50
# Ordner erstellen, falls er noch nicht existiert if (!(Test-Path -Path $ordnerPfad)) { New-Item -ItemType Directory -Path $ordnerPfad }
# Datei erstellen New-Item -ItemType File -Path $dateiPfad New-Item -ItemType File -Path $dateiPfad2
# Text in die Datei schreiben Set-Content -Path $dateiPfad -Value $text Set-Content -Path $dateiPfad2 -Value $text

FileDependency.Rule:
