    &lt;SimpleRule Type=&quot;FilesExist&quot; DirectoryName=&quot;C:\temp\Agenttest_Filedependency&quot; FileName=&quot;Agenttest_Filedependency_Datei3.txt&quot; NumberOfFiles=&quot;&amp;gt;0&quot; /&gt;
    &lt;SimpleRule Type=&quot;FilesExist&quot; DirectoryName=&quot;C:\temp\Agenttest_Filedependency&quot; FileName=&quot;Agenttest_Filedependency_Datei.txt&quot; NumberOfFiles=&quot;&amp;gt;0&quot; /&gt;
  &lt;/ComplexRule&gt;
